import React from "react";
import "./App.css";
import Home from "./Home";
import { BrowserRouter,Route, Router, Routes } from "react-router-dom";
import Cart from "./Cart";


const App = () => {
  return (
    <>

      <BrowserRouter>
      <Routes>
      <Route path="/cart" element={<Cart/>}/>
      </Routes>
      </BrowserRouter>
    </>
  );
};

export default App;
